  return (
<HeaderContainer>

<TitleEDate> 
  <ButtonLeft>     
  <ButtonTrird width={"600%"}>**AGENDA ANIVERSARIANTES **</ButtonTrird> 
  </ButtonLeft> 
  <ButtonRigth>     
  <ButtonLogoAnel/>  
  </ButtonRigth>
  </TitleEDate> 
  
    <ButtonContainer>  
    <ButtonTrird width={"100"}>TOP 10</ButtonTrird>
